export default function Header (){
    return (
        <div className="row block">
            <div>
                <a href="#/">
                    <h2>Simple Shopping Card</h2>
                </a>
            </div>
            <div>
                <a href="#/card">Cart</a>
                <a href="#/signin">Sign In</a>
            </div>
        </div>
    );
}
